  {
    id:2,
    name:"Le Nhien",
  },
  {
    id:3,
    name:"Bao Nguyen",
  },
  {
    id:4,
    name:"Bao Ngoc",
  }
];

export class Users extends Component {
    render() {
        return (
          <div>
            <h1>Đây là demo ReactJS</h1>
            <button type="">Chạy</button>
          </div>
        );
    }
}

export default Users
